import React, { useState } from "react";
import InputForm from "./InputForm";

export default function App() {
  const [vehicles, setVehicle] = useState([]);
  return (
    <div class="container">
      <div class="row top30">
        <div class="col-5 border-add">
          <InputForm getVehicle={(vehicle) => {
            setVehicle([...vehicles, vehicle])
            console.log(vehicles)
          }} />

        </div>
        <div class="col-1" />
        <div class="col-5 border-add">
          <InputForm exit getVehicle={(vehicle) => {
            setVehicle(vehicle)
          }} />

        </div>
      </div>
      <div class="row top30">

        {vehicles.map((item) => {
          return (
            <div class="col-2">
              <button
                className='button'
                type="submit"
              >
                <span>{item.numberPlate}</span>
              </button>
            </div>
          )
        })}
      </div>
    </div>
  );
}
